import { motion } from 'framer-motion';
import './Process.css';

const Process = () => {


  return (
    <div className="process">
      <div className="p-left">
       <div className="brief">
        <div className="num">
          <h1>1</h1>
        </div>
        <div className="name">
         <h1>Briefing</h1>
        </div>
        <div className="describe">
         <p>Send me a detailed brief of the problem statement.</p>
        </div>
       </div>
       <div className="wireframe">
