         <p>Designing the logical structure of the future UI based on research and structure from the customer.</p>
        </div>
       </div>
      </div>
      <div className="p-right">
      <div className="research">
      <div className="num">
          <h1>2</h1>
        </div>
        <div className="name">
         <h1>Research</h1>
        </div>
        <div className="describe">
         <p>Development Begins with competitive and visual analysis, target audience and market research.</p>
        </div>
      </div>
      </div>
    </div>
  );
};

export default Process;


